import React from "react";
import { Row, Col, Card } from "react-bootstrap";
import { motion } from "framer-motion";

const userAccount = () => {
  return (
    <motion.div className="container">
      <Row>
        <Col sm={12}>
          <h3>My Account</h3>
        </Col>
      </Row>
      <Row>
        <Col>
          <Card></Card>
        </Col>
      </Row>
    </motion.div>
  );
};

export default userAccount;
